import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import style from "./NavBar.module.css"
import { useNavigate } from 'react-router-dom';
import brainly from '../../Assets/brainly.jpeg'
const NavBar = () => {
  const navigate = useNavigate();
  const [showMenu, setShowMenu] = useState(false);

  const handleShowUsers = () => {
    navigate('/users');
  }

  const handleShowDoctors = () => {
    navigate('/doctors');
  }

  const toggleMenu = (event) => {
    // event.stopPropagation();
    setShowMenu(!showMenu);
  }

  return (
    <nav className={style.navbar}>

    <img src={brainly} width='50px' height='50px'/>

      <div className={style.container}>
        <Link to="/about" className={style.about}>About</Link>

        <div className={style.dropdownContainer}>
        <button type='button' className={style.dropdownButton} onClick={(e) => {toggleMenu(); e.stopPropagation()}}>
         Nuestros usuarios
        </button>
          
          {showMenu && (
            <ul className={style.dropdownMenu}>
              <li className={style.users} onClick={handleShowUsers}>Pacientes</li>
              <li className={style.doctors} onClick={handleShowDoctors}>Doctores</li>
            </ul>
          )}
        </div>

        <Link to="/form" className={style.btn}>
          <button className={style.login}>LOG IN</button>
        </Link>
      
       <button className={style.premium} >Se Premium‚≠ê</button>
      
      </div>

      

    </nav>
  )
}

export default NavBar;
